public int compareBottom(int doc) {
  assert bottomSlot != -1;
  int order = this.order[doc];
  final int cmp = bottomOrd - order;
  if (cmp != 0) {
    return cmp;
  }

  final String val2 = lookup[order];
  if (bottomValue == null) {
    if (val2 == null) {
      return 0;
    }
    // bottom wins
    return -1;
  } else if (val2 == null) {
    // doc wins
    return 1;
  }
  return bottomValue.compareTo(val2);
}

